import React from "react";
import { Outlet } from "react-router-dom";
import TopNav from "../components/navigation/TopNav";
import SideNav from "../components/navigation/SideNav";

export default function RootLayout() {
  return (
    <>
      <TopNav />

      <SideNav />

      <main>
        <Outlet />
      </main>
    </>
  );
}
